import React from 'react';

const Techs = () => {
    return (
        <section className="techs">
            <h2 className="techs__title">Технологии</h2>
            <div className="techs__container">
                <p className="techs__subtitle"></p>
                <p className="techs__description"></p>
            </div>
        </section>
    );
};

export default Techs;
